<p>数组是一种连续存储线性结构，元素类型相同，大小相等，数组是多维的，通过使用整型索引值来访问他们的元素，数组尺寸不能改变。</p>
<p>数组的<strong>优点</strong>:</p>
<ul>
<li>存取速度快</li>
</ul>
<p>数组的<strong>缺点</strong>:</p>
<ul>
<li>事先必须知道数组的长度</li>
<li>空间通常是有限制的</li>
<li>需要大块连续的内存块</li>
<li>插入删除元素的效率很低</li>
</ul>
